import styled from "styled-components"

export const HeaderButtonLeft = styled.button`
    top: 16px;
    margin-left: 10px;
    left: 10px;
    position: absolute;
    border-radius: 10px;
    border: none;
`;
export const HeaderButtonRight = styled.button`
    margin-right: 10px;
    right: 10px;
    position: absolute;
    border-radius: 10px;
    top: 16px;
    border: none;
`;
export const Header = styled.div`
    background: red;
    height: 64px;
`;
export const Container = styled.div`
    background: yellow;
`;
